    "pre_build": {
      "commands": [
        "pwd",
        "aws s3 cp s3://${SourceBucket}/image.zip image.zip",
        "mkdir -p ./unzip_folder",
        "ls -l",
        "unzip -o image.zip -d ./unzip_folder",
        "ls -l ./unzip_folder"
      ]
    },
    "build": {
      "commands": [
        "pwd",
        "echo \"Create to Lambda  is Running\"",
        "bash ./unzip_folder/lambda.sh",
        "echo \"Lambda has been created\""
      ]
    }
  }
